import React, { Component } from "react";

class Ninjas extends Component {
  render() {
    //   console.log(this.props);
    const { name, age } = this.props;
    return (
      <div className="ninja">
        <div>Name: {name}</div>
        <div>Name11: {this.props.age}</div>
      </div>
    );
  }
}

export default Ninjas;
